import React from 'react';
import './css/Study.css'; // Import CSS for styling

const ClassPage = () => {
  return (
    <div className="class-page">
      <header className="class-page-header">
        <div className="logo">Quizizz</div>
        <div className="search-bar">
          <input type="text" placeholder="Find a quiz" />
          <button className="search-button">&#128269;</button>
        </div>
        <nav className="navigation">
          <a href="/">Home</a>
          <a href="/activity">Activity</a>
          <a href="/classes" className="active">Classes</a>
        </nav>
        <button className="dashboard-button">Instructor Dashboard</button>
      </header>

      <main className="main-content">
        <div className="empty-state">
          <img src="path/to/image.png" alt="Empty state" className="empty-image" /> {/* Replace with actual image path */}
          <h2>You havenâ€™t joined any classes yet.</h2>
          <p>Quizizz is more fun with friends.</p>
          <button className="join-class-button">Join a Class</button>
        </div>
      </main>
    </div>
  );
};

export default ClassPage;
